If you want to specify a union type but with a constraint that the value will always be of a certain type, you can use the following approaches:

### Approach 1: Using `as const` with a conditional type

```typescript
type AlwaysString = 'Hello' | 'World' | readonly ['Hello', 'World'][number];

function greet(x: AlwaysString): void {
  // Here, TypeScript knows that x is always a string.
  console.log(x.toUpperCase());
}
```

### Approach 2: Using a generic function with a type parameter

```typescript
function alwaysString<T extends 'Hello' | 'World' | readonly ['Hello', 'World'][number]>(x: T): void {
  // Here, TypeScript knows that x is always a string.
  console.log(x.toUpperCase());
}

alwaysString('Hello'); // OK
alwaysString('World'); // OK
alwaysString(['Hello', 'World'][0]); // OK
```

### Approach 3: Using a type guard

```typescript
function isAlwaysString<T>(x: T): x is 'Hello' | 'World' | readonly ['Hello', 'World'][number] {
  return ['Hello', 'World'].includes(x);
}

function greet(x: 'Hello' | 'World' | readonly ['Hello', 'World'][number]): void {
  if (isAlwaysString(x)) {
    // Here, TypeScript knows that x is always a string.
    console.log(x.toUpperCase());
  }
}
```

Note that in the above examples, `readonly` is used to make an array of strings readonly, to avoid runtime mutations.

