**Word Counting Program in C++**
================================

This program reads a text file line by line and counts the number of occurrences of a specific word in the file.

### Code

```cpp
#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <algorithm>

// Function to count the occurrences of a word in a string
int countWord(const std::string& text, const std::string& word) {
    std::string copy = text;
    std::string trimmed = copy;
    // Remove leading and trailing whitespace
    trimmed.erase(0, trimmed.find_first_not_of(" \n\r\t"));
    trimmed.erase(trimmed.find_last_not_of(" \n\r\t") + 1);

    // Convert to lowercase for case-insensitive comparison
    std::transform(trimmed.begin(), trimmed.end(), trimmed.begin(), ::tolower);
    std::string wordLower = word;
    std::transform(wordLower.begin(), wordLower.end(), wordLower.begin(), ::tolower);

    size_t pos = trimmed.find(wordLower);
    int count = 0;
    while (pos!= std::string::npos) {
        count++;
        pos = trimmed.find(wordLower, pos + 1);
    }
    return count;
}

int main() {
    std::string filename;
    std::string word;

    // Prompt user for input
    std::cout << "Enter the filename: ";
    std::cin >> filename;

    std::cout << "Enter the word to count: ";
    std::cin >> word;

    // Open the file in read mode
    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Error opening file " << filename << std::endl;
        return 1;
    }

    // Read the file line by line
    std::string line;
    int total = 0;
    while (std::getline(file, line)) {
        total += countWord(line, word);
    }
    file.close();

    // Print the result
    std::cout << "The word '" << word << "' appears " << total << " times in the file." << std::endl;

    return 0;
}
